('2016-SA-FT-049', '0120200479', 75, 'Me intereso el tema, aunque muchas veces creemos que sabemos sobre el tema es bueno actualizarse y conocer algÃºn Ã¡mbito que se desconoce'),
('2017-SS-FT-0081', '0120180441', 100, 'Por que me pareciÃ³ bastante enriquecedor en contenido mostrando como nuestra forma de pensar sobre el estrÃ©s es importante en nuestras vidas, ademÃ¡s el vÃ­deo no me aburriÃ³ y fue bastante bueno a mi punto de vista. '),
('2017-SA-FT-0043', '0120200479', 100, 'Es un tema super interesante porque las expresiones corporales dicen mucho en cualquier momento. '),
('2016-SS-FT-0004', '0120150443', 100, 'Estuvo muy bonito el taller, muy informativo'),
('2017-SA-FT-0011', '0120150464', 75, 'Ya que explica el uso de una nueva herramienta y la utilidad de esta mediante un tutorial informativo y me parece interesante.'),
