(13, '0120130342', 'Que los jÃ³venes comprendan la importancia del ahorro para su plan de vida'),
(14, '0120130342', 'Que los jÃ³venes comprendan la importancia del ahorro para su plan de vida'),
(16, '0120090375', 'Que los jÃ³venes comprenda la importancia del ahorro para su plan de vida '),
(17, '0120110369', 'Que los estudiantes logren identificar  las partes fundamentales de contenido y forma adecuada al momento de realizar un Curriculum Vitae '),
(18, '0120160379', 'Crear conciencia sobre la honestidad e integridad como valores esenciales para construir la convivencia humana y establecer una buena conveniencia entre el entorno. '),
(21, '0120230354', 'Conocer la influencia que posee el lenguaje corporal en la comunicaciÃ³n con terceros asÃ­ como con la persona misma'),
(22, '0120280363', 'Que los alumnos aprendan a convivir con personas con diferentes costumbres a las nuestras .'),
(23, '0120150443', 'Aprender sobre los comportamientos  y modales esperados en muchos ambientes laborales fÃ­sicos y digitales, que permitirÃ¡n que los jÃ³venes se relacionen con cordialidad con sus equipos de trabajo.'),
(24, '0120160420', 'Concientizar a chicos y chicas sobre la importancia de tener control de las propias emociones en el ambiente laboral'),
(25, '0120150464', 'El Objetivo es que el estudiante conozca el funcionamiento y las diversas Herramientas que la red social de Linkledln puede proporcionarle, y que sea capaz de poder utilizarla a su favor para la bÃºsqueda de oportunidades laborales y crear networking, que le beneficie en su vida laboral y personal.'),
(26, '0120220424', 'Que los estudiantes conozcan la importancia de brindar una primera buena impresiÃ³n tanto en el Ã¡mbito laboral como personal, asÃ­ como tambiÃ©n que evalÃºen cual consideran ellos que es la primera impresiÃ³n que ellos proyectan.'),
(27, '0120270412', 'Desarrollar criterio y sano cuestionamiento en los y las jÃ³venes, para que asÃ­ tomen de forma estratÃ©gica decisiones'),
(28, '0120200479', 'Aprender sobre las reglas de etiquetas bÃ¡sicas en los lugares de trabajo'),
(29, '0120180441', 'Desarrollar estrategias para gestionar de mejor forma el estrÃ©s, ademÃ¡s de crear conciencia en los jÃ³venes  sobre la importancia que tiene la percepciÃ³n  que poseen del estrÃ©s, para el manejo del mismo.'),
(30, '0120200450', 'Comprender que hoy por hoy en el mundo laboral la primera impresiÃ³n debe ser altamente profesional, pues es muy tomada en cuenta al momento de la contrataciÃ³n o de la creaciÃ³n de la reputaciÃ³n.'),
(31, '0120250443', 'Que los beneficiarios aprendan estrategias de autocuido, que les permita mantener lÃ­mites sanos en el trabajo. '),
(32, '0120250466', 'Aprender la importancia de realizar acciones conscientes para alcanzar un equilibrio entre la vida laboral y personal, para poder ser personas sanas y realizadas.'),
(33, '0120230497', 'El presente taller tiene como objetivo que los jÃ³venes conozcan estrategias que les permitirÃ¡n tener una vida financiera mas saludable, gracias al correcto manejo del dinero'),
(34, '0120240426', 'Concientizar a chicos y chicas sobre la importancia de tener control de las propias emociones en el ambiente laboral'),
(35, '0120160487', '1. Aprender a utilizar el tiempo que disponemos y maximizar el uso del mismo. \r\n2. Aprender a controlar el tiempo. \r\n3. Analizar las causas que nos hacen perder el tiempo. '),
(36, '0120290448', 'Que los alumnos entiendan que ellos son responsables de tomar el control de los acontecimientos en vez de quedarse mirando como suceden las cosas. '),
(37, '0120300428', 'Que los alumnos aprendan a como decir Si o No, con firmeza definiendo sus intereses y sin perjudicar a nadie. '),
(38, '0120170469', 'Que los jÃ³venes conozcan los diferentes elementos a tomar en cuenta para elegir un empleo'),
(39, '0120220468', 'Explicar la herramienta desde quien la usa para bÃºsqueda de empleo'),
(40, '0120040577', 'Prepara a chicos y chicas para las caracterÃ­sticas del mercado laboral, que demandan flexibilidad en los puestos que ellos desempeÃ±en '),
