(42, '0120110548', 'Crear consciencia sobre la importancia de nuestras acciones diarias tanto fuera como dentro de las redes sociales y como esto influencia nuestra imagen profesional'),
(43, '0120110511', 'Crear consciencia sobre la importancia de nuestras acciones diarias tanto fuera como dentro de las redes sociales y como esto influencia nuestra imagen profesional'),
