INSERT INTO `preguntas` (`id`, `pregunta`, `respuesta`, `fechaRespuesta`) VALUES
(47, '¿Cómo me tengo que registrar en Moodle?', 'En la landing page de Workeys encontrarás un botón llamado tutoriales Workeys. Ahí­ encontrarás el video tutorial con las indicaciones de cómo tendrás que hacer tu registro en Moodle.', '2020-09-9 12:27'),
(48, '¿En qué meses me puedo registrar?', 'Solamente se abre inscripciones en los meses de enero y julio de cada año ', '2020-09-10 12:27'),
(49, '¿Cuánto dura la Certificación Workeys?', 'Dura 9 meses, pero si dejas un módulo te retrasas y la duración se extenderá¡. ', '2020-09-11 12:27'),
(50, '¿Qué pasa si no me inscribo?', 'Tu beca podría ser condicionada, revocada o podrías perder el apoyo que recibes por parte de la fundación.', '2020-09-11 12:28'),
(51, '¿Qué tengo que hacer si no me inscribo?', 'Redactar un correo dirigido a Mónica de Gálvez y Keny Márquez, en donde expongas los motivos por los cuales no pudiste inscribirte. Ellas analizarán caso por caso y sí tu caso de no inscripción se considera validado serás notificado ', '2020-09-11 12:29'),
(52, '¿Qué pasa si dejo un módulo?', 'Tu beca podría ser condicionada, revocada o podrías perder el apoyo que recibes por parte de la fundación.', '2020-09-1 12:29'),
(53, '¿Cuál es la nota máxima para aprobar cada módulo de la certificación?', 'La nota mínima es 8.5, toda nota menor a esta se considera reprobado', '2020-09-11 12:30'),
(54, '¿Por qué debo cursar la certificación?', 'Porque aprenderás lo que está demandando actualmente el mercado laboral \r\n-SerÃ¡ un requisito para aplicar a la bolsa de empleo Oportunidades. \r\n-Es un requisito obligatorio para mantener tu beca y/o apoyo que recibes por parte de la fundaciÃ³n.\r\n', '2020-07-11 12:30'),
(55, '¿Por qué tengo que cursar la certificación para aplicar a la Bolsa de Empleo Oportunidades?', 'Porque con la certificación el coach tiene seguridad que has visto y aprendido el contenido que es importante para desempeñarte laboralmente. ', '2020-09-11 12:30'),
(56, '¿Qué porcentajes representan las actividades de mi nota final?', 'El trabajo final un 55%\r\nEl promedio de la nota de los talleres 35%\r\nLos foros de cada semana 15%', '2020-07-11 12:31');
