(20202289, 'EST005', '2013-SS-FT-0083', 'Actualmente estoy estudiando y trabajando en una agencia enfocada en la identidad de marcas y al creaciÃ³n de proyectos. Por el momento, no hay definido un perÃ­odo de finalizaciÃ³n de mis prÃ¡cticas laborales, ya que hay posibilidad de que me quede ', '20202289.pdf', 'Gracias por compartir esta info.', '2020-05-29 12:09:29', 'Aprobado', '2020-12-12'),
(20204194, 'EST005', '2015-SS-FT-0033', 'Desde finales de 2019, estoy trabajando en mi propia empresa llamada \"Aviza\", una aplicaciÃ³n mÃ³vil que busca mejorar las condiciones del sistema de transporte pÃºblico en nuestro paÃ­s. En el mes de enero de 2020, comenzamos a operar de manera lega', '20204194.pdf', 'Excelente Juan, felicidades y gracias por compartir esta informaciÃ³n.', '2020-05-29 12:11:17', 'Aprobado', '2020-12-31'),
(20204394, 'EST005', '2014-SS-SAT-0020', 'Trabajo fijo desde enero 2020 como Analista de Inversiones', '20204394.pdf', '', '2020-03-25 19:19:21', 'En espera', '2020-12-31'),
(20205171, 'ESP004', '2015-SS-SAT-0028', 'A inicios de marzo comencÃ© a realizar mi pasantÃ­a en FUSADES en el departamento de estudios sociales. Esta durarÃ¡ 6 meses.', '20205171.pdf', 'Gracias por compartir Santiago!', '2020-05-29 12:17:18', 'Aprobado', '2020-08-31'),
